Looking for ways to reduce the risk of Covid-19 whilst retaining occupier comfort?

@CIBSEJournal has updated its Covid-19 guidance for winter. 

The document provides guidance on the use of natural ventilation openings, recirculation and thermal wheels.

Do you have sight loss or know someone who does?  Here is advice on safe guiding and social distancing during the coronavirus pandemic.  #SensoryLossAwarenessMonth #ItMakesSense2020
